import React from 'react';

const Starred = ({ starred }) => (
    <div className="card card-body mb-2">
        <div className="row">
            <div className="col-mb-6">
                <a href= {`${starred.html_url}`} target="blank">{ repo.name }</a>
            </div>
            <div className="col-md-6">
                <span className="badge badge-primary"> { starred.name }</span>
                <span className="badge badge-secondary"> { starred.owner.login}</span>
            </div>
        </div>
    </div>
)

export default Starred;

